export const Navbar = () => {
  return (
    <div className='navbar'>
      <div className="wrapper">
        <div className="searh">
          <input type="text" placeholder='Search...'/>
          <SearchOutlinedIcon/>
        </div>
      </div>
    </div>
  )
}
